import{_ as a,c as p,j as e,a as r,G as i,a4 as s,B as o,o as n}from"./chunks/framework.DbLu_ZlF.js";const c="/replit/replit-01.png",d="/replit/replit-02.png",g="/replit/replit-03.png",m="/replit/replit-04.png",h="/replit/replit-05.png",y="/replit/replit-06.png",_="/replit/replit-07.png",u="/replit/replit-08.png",k="/replit/replit-09.png",b="/replit/replit-10.png",f="/replit/replit-11.png",x="/replit/replit-12.png",z="/replit/replit-13.png",v="/replit/replit-14.png",w="/replit/replit-15.png",R="/replit/replit-16.png",T="/replit/replit-17.png",C="/replit/replit-18.png",N="/replit/replit-19.png",F="/replit/replit-20.png",P="/replit/replit-21.png",W="/replit/replit-22.png",q="/replit/replit-23.png",S="/replit/replit-24.png",V="/replit/replit-25.png",A="/replit/replit-26.png",L="/replit/replit-27.png",j="/replit/replit-28.png",B="/replit/replit-29.png",E="/replit/replit-30.png",M="/replit/replit-31.png",X="/replit/replit-32.png",I="/replit/replit-33.png",O="/replit/replit-34.png",U="/replit/replit-35.png",Y="/replit/replit-36.png",J="/replit/replit-37.png",D="/replit/replit-38.png",G="/replit/replit-39.png",H="/replit/replit-40.png",Z="/replit/replit-41.png",$="/replit/replit-42.png",K="/replit/replit-43.png",Q="/replit/replit-44.png",tt="/replit/replit-45.png",et="/replit/replit-46.png",lt="/replit/replit-47.png",at="/replit/replit-48.png",gt=JSON.parse('{"title":"Replit的注册及使用","description":"","frontmatter":{},"headers":[],"relativePath":"yiov/website/Replit.md","filePath":"yiov/website/Replit.md","lastUpdated":1734678955000}'),pt={name:"yiov/website/Replit.md"};function rt(it,t,st,ot,nt,ct){const l=o("ArticleMetadata");return n(),p("div",null,[t[0]||(t[0]=e("h1",{id:"replit的注册及使用",tabindex:"-1"},[r("Replit的注册及使用 "),e("a",{class:"header-anchor",href:"#replit的注册及使用","aria-label":'Permalink to "Replit的注册及使用"'},"​")],-1)),i(l),t[1]||(t[1]=s('<div class="tip custom-block"><p class="custom-block-title">(当前界面文档全部来自yiov.top)</p><ul><li><a href="https://yiov.top/" target="_blank" rel="noreferrer">yiov</a>「伊奥&#39;s 教程集」</li></ul></div><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>Replit是一个基于浏览器的云端协同开发平台，可用于构建开发环境、实时协作、托管网络应用、创建动态或者静态网站的容器等</p><p>官网：<a href="https://replit.com/" target="_blank" rel="noreferrer">https://replit.com/</a></p><p>文档：<a href="https://docs.replit.com/" target="_blank" rel="noreferrer">https://docs.replit.com/</a></p><p>GitHub：<a href="https://github.com/replit" target="_blank" rel="noreferrer">https://github.com/replit</a></p><p><img src="'+c+'" alt="" loading="lazy"></p><h2 id="客户端" tabindex="-1">客户端 <a class="header-anchor" href="#客户端" aria-label="Permalink to &quot;客户端&quot;">​</a></h2><ul><li><p><a href="https://replit.com/desktop" target="_blank" rel="noreferrer">电脑端</a></p></li><li><p><a href="https://apps.apple.com/cn/app/replit-idea-to-software-fast/id1614022293" target="_blank" rel="noreferrer">苹果端</a></p></li><li><p><a href="https://replit.com/mobile" target="_blank" rel="noreferrer">安卓端</a></p></li></ul><h2 id="注册" tabindex="-1">注册 <a class="header-anchor" href="#注册" aria-label="Permalink to &quot;注册&quot;">​</a></h2><p>点击 <code>Log in</code> 注册，可以用第三方关联注册，我选择 <a href="./../website/pages/github.html">GitHub</a></p><details class="details custom-block"><summary>网站打不开？</summary><p>那有可能你需要 <a href="./../gfw/channel.html">挂一个梯子</a></p></details><p><img src="'+d+'" alt="" loading="lazy"></p><p>注册好，进入主界面，可以修改你的昵称，问你用于何处和多少开发经验</p><p><img src="'+g+'" alt="" loading="lazy"></p><p><img src="'+m+'" alt="" loading="lazy"></p><p>最后，根据上方提示邮箱验证一下即可</p><p><img src="'+h+'" alt="" loading="lazy"></p><p><img src="'+y+'" alt="" loading="lazy"></p><p>还可以在 <code>Account - Profile - through the CLI</code> 修改用户名</p><p><img src="'+_+'" alt="" loading="lazy"></p><h2 id="使用" tabindex="-1">使用 <a class="header-anchor" href="#使用" aria-label="Permalink to &quot;使用&quot;">​</a></h2><details class="details custom-block"><summary>生成Wireguard配置</summary><p>打开 <a href="https://github.com/yonggekkk/warp-yg" target="_blank" rel="noreferrer">@甬哥</a> 的脚本 <a href="https://replit.com/@yonggekkk/WARP-Wireguard-Register" target="_blank" rel="noreferrer">WARP-Wireguard-Register</a> ，点 <code>Rork&amp;Run</code></p><details class="details custom-block"><summary>其他同类脚本</summary><p><a href="https://replit.com/@misaka-blog/wgcf-profile-generator" target="_blank" rel="noreferrer">@misaka-blog：注册warp密钥</a></p><p><a href="https://replit.com/@misaka-blog/warpgo-profile-generator" target="_blank" rel="noreferrer">@misaka-blog：生成Wireguard配置</a></p></details><p><img src="'+u+'" alt="" loading="lazy"></p><p>名称可改可不改，点 <code>Fork Repl</code></p><p><img src="'+k+'" alt="" loading="lazy"></p><p>Fork成功会自动进入仓库运行</p><details class="details custom-block"><summary>没有运行怎么办</summary><p>返回 <a href="https://replit.com/~" target="_blank" rel="noreferrer">Replit主页</a> ，点击项目进入自动运行</p><p>未运行点击顶部的 <code>RUN</code></p></details><p><img src="'+b+'" alt="" loading="lazy"></p><p>我这里就以 <a href="./cloudflare.html#使用">CloudFare的 Zero Trust</a> 演示</p><p>输入<code>1</code>，选择warp-go回车，在输入 <code>3</code>，选择warp-go-teams回车</p><details class="details custom-block"><summary>warp-go 、wgcf、warp api的区别</summary><ul><li><p>warp-go：最新内核</p></li><li><p>wgcf：老内核</p></li><li><p>warp api：官方申请api，有几率失败</p></li></ul></details><p><img src="'+f+'" alt="" loading="lazy"></p><p>点击链接获取 <a href="https://web--public--warp-team-api--coia-mfs4.code.run/" target="_blank" rel="noreferrer">Teams团队Token</a></p><p><img src="'+x+'" alt="" loading="lazy"></p><p>输入你在 <a href="./cloudflare.html#使用">CloudFare中注册的团队名</a></p><p><img src="'+z+'" alt="" loading="lazy"></p><p>使用的邮箱 (与注册时填入的邮箱后缀保持一致)</p><p><img src="'+v+'" alt="" loading="lazy"></p><p>填入验证码</p><p><img src="'+w+'" alt="" loading="lazy"></p><p>获取到ey开头的token</p><p><img src="'+R+'" alt="" loading="lazy"></p><p>复制这一长串token</p><p><img src="'+T+'" alt="" loading="lazy"></p><p>回到Replit 右键，Paste 粘贴，回车</p><p><img src="'+C+'" alt="" loading="lazy"></p><p>申请成功后WireGuard配置，可以导入 <a href="./../gfw/wireguard.html">WireGuard使用</a></p><p><img src="'+N+'" alt="" loading="lazy"></p></details><details class="details custom-block"><summary>搭建Xray节点</summary><p>这里使用 <a href="https://github.com/yonggekkk/Replit-Xray" target="_blank" rel="noreferrer">@甬哥</a> 的脚本包 <a href="https://raw.githubusercontent.com/yonggekkk/Replit-Xray/main/vmvltrssso.zip" target="_blank" rel="noreferrer">vmvltrssso.zip</a>，并解压</p><p><img src="'+F+'" alt="" loading="lazy"></p><p>左上角 <code>+ Create Repl</code></p><p><img src="'+P+'" alt="" loading="lazy"></p><p>选择 <code>Blank Repl</code></p><p><img src="'+W+'" alt="" loading="lazy"></p><p>名称Title随意，但不要出现代理协议的字眼，点击创建Create Repl</p><p><img src="'+q+'" alt="" loading="lazy"></p><p>等待创建完成即可</p><p><img src="'+S+'" alt="" loading="lazy"></p><p>然后将解压后的4个文件，全部拖到左侧文件栏内进行覆盖</p><p><img src="'+V+'" alt="" loading="lazy"></p><p>会提示是否覆盖，点Yes</p><p><img src="'+A+'" alt="" loading="lazy"></p><p>上传完成，左侧文件栏显示 <code>√ saved</code> 即可，点 <code>Run</code> 运行</p><p><img src="'+L+'" alt="" loading="lazy"></p><p>多等一会运行起来后，点 <code>New Tab</code></p><p><img src="'+j+`" alt="" loading="lazy"></p><p>复制这个网址，一会要用到，去掉 <code>https://</code> 和尾部的 <code>/</code></p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark has-diff vp-code" tabindex="0"><code><span class="line diff remove"><span>https://123456.pike.replit.dev/</span></span>
<span class="line"><span></span></span>
<span class="line diff add"><span>123456.pike.replit.dev</span></span></code></pre></div><p><img src="`+B+'" alt="" loading="lazy"></p><p>然后再左侧 <code>Secret</code>，右侧点 <code>+ New Secret</code></p><p><img src="'+E+'" alt="" loading="lazy"></p><p>key输入 <code>ym</code>，值 <code>Value</code> 输入刚才不带http斜杠的网址，添加 <code>Add Secret</code></p><p><img src="'+M+'" alt="" loading="lazy"></p><p>然后点击顶部停止 <code>stop</code>，重新 <code>Run</code></p><p><img src="'+X+'" alt="" loading="lazy"></p><p>等待生成，方案一要手搓，我们可以直接点击方案2的链接</p><p><img src="'+I+'" alt="" loading="lazy"></p><p>挑你喜欢的协议导入 <a href="./../gfw/proxy.html">科学上网工具</a> ，不知道选哪个就选Vmess / Vless</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>默认是443端口，不可以更改</p><p>默认开启TLS，不可以关闭</p></div><p><img src="'+O+'" alt="" loading="lazy"></p><p>我这里使用V2ray演示，复制VMess节点，剪切板导入</p><p><img src="'+U+'" alt="" loading="lazy"></p><p>导入成功后，右键 - 测试服务器真连接延迟</p><details class="details custom-block"><summary>如何将印度节点切换成美国节点</summary><p>Replit主页头像 - Account - Your server location，将原先的 Asia 改成 <code>North America</code></p></details><p><img src="'+Y+'" alt="" loading="lazy"></p><p><img src="'+J+'" alt="" loading="lazy"></p><p>然后下方，选择 <code>自动配置系统代理</code>，访问 <a href="https://www.google.com/" target="_blank" rel="noreferrer">谷歌</a> 看看</p><details class="details custom-block"><summary>打不开网页，代理工具真链接延迟-1ms</summary><p>双击节点，在节点配置中，将 <code>TLS</code> 关闭，再重新开启 <code>TLS</code> 看看是否恢复正常</p></details><p><img src="'+D+'" alt="" loading="lazy"></p></details><details class="details custom-block"><summary>搭建Xray节点 补充：argo隧道</summary><div class="warning custom-block"><p class="custom-block-title">前提</p><p>注册 <a href="./cloudflare.html">Cloudflare</a> 账号，自己有一个域名并已解析在Cloudflare上</p><p>否则不用看！！！</p></div><p>进入 Cloudflare - Zero Trust</p><p><img src="'+G+'" alt="" loading="lazy"></p><p>然后再 Networks - Tunnels - Add a tunnel</p><p><img src="'+H+'" alt="" loading="lazy"></p><p>选择 Cloudflared，下一步</p><p><img src="'+Z+'" alt="" loading="lazy"></p><p>自己取一个隧道名，保存</p><p><img src="'+$+`" alt="" loading="lazy"></p><p>然后自动生成了token，我们复制出来，一会要用，下一步</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>复制出来是这样的，我们只需要 <code>ey开头</code> 直到结尾的字符，前面的都删掉</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">cloudflared.exe</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> service</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">eyJhIjoiYmVjNjVjODk5NzVhN2JhYTM5ODA5OWExM2UwNDYyNWEiLCJ0IjoiOTZiNWYyYjgtZWVmMS00M2FiLWFjMzctYWIwNjJhODU4OTE2IiwicyI6Ik5tVTJNalE1WXpNdE1EazNZeTAwTUdRNUxXSTVaRFF0TnpKa09XUmpOekF4WWpjMyJ9</span></span></code></pre></div></div><p><img src="`+K+'" alt="" loading="lazy"></p><p>然后给隧道添加一个域名，保存</p><div class="tip custom-block"><p class="custom-block-title">说明</p><ul><li><p>subdomain：二级域名</p></li><li><p>Domain:主域名(需提前解析到Cloudfare)</p></li><li><p>Path：留空即可</p></li><li><p>Type：选 <code>HTTP</code></p></li><li><p>URL：<code>127.0.0:8089</code></p></li></ul></div><p><img src="'+Q+'" alt="" loading="lazy"></p><p>这样我们就得到了一个二级域名的隧道网址</p><p><img src="'+tt+'" alt="" loading="lazy"></p><p>返回Replit，根据 <a href="https://github.com/yonggekkk/Replit-Xray" target="_blank" rel="noreferrer">@甬哥的文档</a> 分别添加密钥 <code>argotoken</code> 和 <code>argoym</code></p><table tabindex="0"><thead><tr><th style="text-align:center;">变量名称</th><th style="text-align:center;">变量值</th><th style="text-align:center;">变量说明</th></tr></thead><tbody><tr><td style="text-align:center;">ym</td><td style="text-align:center;">replit生成的域名</td><td style="text-align:center;">首次运行后必填<br>注意：不要带 <code>https://</code> 且末尾不要带 <code>/</code></td></tr><tr><td style="text-align:center;">argotoken<br><code>可选</code></td><td style="text-align:center;">CF生成的一串token</td><td style="text-align:center;">argo固定隧道token，<br>但必须与argoym变量同时存在</td></tr><tr><td style="text-align:center;">argoym<br><code>可选</code></td><td style="text-align:center;">CF设置的隧道域名</td><td style="text-align:center;">argo固定隧道域名，<br>但必须与argotoken变量同时存在</td></tr><tr><td style="text-align:center;">uuid<br><code>可选</code></td><td style="text-align:center;">自定义uuid</td><td style="text-align:center;">已自动生成，可以自行更改</td></tr><tr><td style="text-align:center;">www<br><code>可选</code></td><td style="text-align:center;">数字1-9任选一个数字</td><td style="text-align:center;">9个网页中随机选择一个伪装</td></tr><tr><td style="text-align:center;">ver<br><code>可选</code></td><td style="text-align:center;">任意字符</td><td style="text-align:center;">Xray1.4.3版支持苹果oneclick免费客户端</td></tr></tbody></table><p><img src="'+et+'" alt="" loading="lazy"></p><p>重新 <code>Run</code> 即可看到固定的隧道名</p><p><img src="'+lt+'" alt="" loading="lazy"></p><p>重新订阅节点，或者双击节点修改 <code>伪装域名host</code> 和 <code>SNI</code> 为伪装域名</p><table tabindex="0"><thead><tr><th style="text-align:center;">类型</th><th style="text-align:center;">HTTP</th><th style="text-align:center;">HTTPS</th></tr></thead><tbody><tr><td style="text-align:center;">节点</td><td style="text-align:center;">vless+ws</td><td style="text-align:center;">vless+ws+tls</td></tr><tr><td style="text-align:center;">端口</td><td style="text-align:center;">80、8080、8880、2052、2082、2086、2095</td><td style="text-align:center;">443、8843、2053、2083、2087、2096</td></tr><tr><td style="text-align:center;">TLS</td><td style="text-align:center;">关闭</td><td style="text-align:center;">开启</td></tr><tr><td style="text-align:center;">域名</td><td style="text-align:center;">非必须提供</td><td style="text-align:center;">必须提供</td></tr></tbody></table><p><img src="'+at+'" alt="" loading="lazy"></p></details><h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2><h4 id="_1-replit如何保活" tabindex="-1">1.Replit如何保活 <a class="header-anchor" href="#_1-replit如何保活" aria-label="Permalink to &quot;1.Replit如何保活&quot;">​</a></h4><p>这也是Replit最大的弊端，关闭网页或者较长时间，脚本就自动停止了</p><p>目前的解决办法，只能 <a href="#客户端">下载客户端</a> 后台挂机</p><h4 id="_2-replit可以部署alist" tabindex="-1">2.Replit可以部署Alist <a class="header-anchor" href="#_2-replit可以部署alist" aria-label="Permalink to &quot;2.Replit可以部署Alist&quot;">​</a></h4><p>以前可以，现在不行了</p><h4 id="_3-网页打不开-节点测试-1ms" tabindex="-1">3.网页打不开，节点测试-1ms <a class="header-anchor" href="#_3-网页打不开-节点测试-1ms" aria-label="Permalink to &quot;3.网页打不开，节点测试-1ms&quot;">​</a></h4><p>双击节点，在节点配置中，将 TLS 关闭，再重新开启 TLS 看看是否恢复正常</p>',33))])}const mt=a(pt,[["render",rt]]);export{gt as __pageData,mt as default};
